import react, { Component } from "react";

export default class Sidebar extends Component {
  render() {
    return (
      <aside>
        <ul>
          {this.props.posts &&
            this.props.posts.map((post) => (
              <li
                key={post.id}
                onClick={(p) => {
                  console.log("post click");
                  this.props.onPostClick(post.id);
                }}
              >
                {post.title}
              </li>
            ))}
        </ul>
      </aside>
    );
  }
}
